			shellScript = "find \"$TARGET_BUILD_DIR/$FULL_PRODUCT_NAME\" '(' -name '.svn' -or -name '.DS_Store' ')' -prune -print0 | xargs -0 rm -rf\n\n\nlogger \"${SRCROOT}/Resources\"\n\n\n#5) Add (and copy) the super framework to your app and weak link it\n#with all of the sub frameworks of your umbrella framework (by adding\n#\"-weak_framework subFramework\" to the other linker flags).\n\n\n\n#/usr/local/bin/appledoc \"${SRCROOT}/Resources\"\n\n#mkdir \"/ServiceData/www/mrgray/docs/${WRAPPER_NAME}\"\n\n#/usr/local/bin/appledoc \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--project-name \"${WRAPPER_NAME}\" \t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--project-company \"mrgray.com\" \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--company-id com.mrgray \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--output \"/ServiceData/www/mrgray/docs/${WRAPPER_NAME}\" \t\t\t\t\t\t\t\t\t\\\n--docset-feed-url \"http://mrgray.com/docs/${WRAPPER_NAME}/%DOCSETATOMFILENAME\" \t\t\t\\\n--docset-package-url \"http://mrgray.com/docs/${WRAPPER_NAME}/%DOCSETPACKAGEFILENAME\" \t\\\n--publish-docset \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--keep-undocumented-objects \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--keep-undocumented-members \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n--search-undocumented-doc \t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\t\\\n.\n\n\n# Add custom icon (adding CFBundleIconFile to plist and .icns file in /Resources doesn't work, so we have to duplicate what happens when you paste an icon into the Finder Get Info window)\n\n# copy custom icon into top level of bundle and rename to \"Icon\" with a *trailing CR*.  path_to_icon is the path to the source icon file, already in the correct format ('icns' resource ID -16455 in resource fork), but with different filename.\n\ncp \"${SRCROOT}/Resources/atoz.icns\" \"${TARGET_BUILD_DIR}/${PRODUCT_NAME}.${WRAPPER_EXTENSION}/\"$(echo -ne \"Icon\\r\")\n\n# make custom icon file invisible\n/Developer/Tools/SetFile -a V \"${TARGET_BUILD_DIR}/${PRODUCT_NAME}.${WRAPPER_EXTENSION}/\"$(echo -ne \"Icon\\r\")\n\n# mark